import React from 'react';
import './Car.css';

 

class Car extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
      ovnerName: 'sosi',
      carLable: 'mazda',
      carEngine: true,
      carDriveMotion: true,
      carWheels: true
      
    };
    }
  
    render() {
      return (
        <div>
          <div>{this.state.ovnerName}</div>
          <div>{this.state.carLable}</div>
          <div>{this.state.carEngine ? 'Заведён' : 'Заглушён'}</div>
          <div>{this.state.carEngine ? 'Едет' : 'Стоит'}</div>
          <div>{this.state.carEngine ? 'Крутятся' : 'Не крутятся'}</div>
          <button onClick={carEngine}>Завести</button>
          <button>Заглушить</button>
          <button>Поехать</button>
          <button>Остановиться</button>
        </div>
      );
    }
  }
  





  export default Car;
